(1, 'Home', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'Enjoy the beautiful desert scenery, including beautiful sand dunes, from the luxurious Palace on Wheels India. India looks even more beautiful when you are riding the fourth-best luxury train in the world. Leaving New Delhi every Wednesday night, the trip goes to the desert and comes back the next Wednesday morning. This amazing Palace on Wheels Tour Package lasts for eight days and seven nights and covers more than 3,000 km (1850 miles). This trip is the best way to learn about history and have amazing activities.<br><br>The most luxurious accommodations, which evoke a bygone age, and the friendly service ensure that travellers have a memorable trip. A relaxing spa, nice seats and a fully stocked bar are some of the things that the Palace on Wheels India Tour has to offer. Trains stop every day at famous landmarks and old cities, where tourists can see great palaces, busy bazaars, and strong forts, which opens their thoughts to new ideas. Since everything was planned so well, guests will be able to see all of Rajasthan\'s cultures, from the busy bazaars in Jaipur to the calm lakes in Udaipur. The skilled cooks on the gourmet dining trip mix modern and traditional Indian foods to make tasty meals that you can eat at sea. You can take a unique trip through the middle of India on the Palace on Wheels Travel Tour. It stands out because it has a mix of fancy things, easy things to do, and 